package com.structurizr.view;

import org.junit.Before;
import org.junit.Test;

import static org.junit.Assert.assertEquals;
import static org.junit.Assert.assertNull;

public class BrandingTests {

    private Branding branding;

    @Before
    public void setUp() {
        this.branding = new Branding();
    }

    @Test
    public void test_setLogo_WithAUrl() {
        branding.setLogo("https://structurizr.com/static/img/structurizr-logo.png");
        assertEquals("https://structurizr.com/static/img/structurizr-logo.png", branding.getLogo());
    }

    @Test
    public void test_setLogo_WithADataUri() {
        branding.setLogo("data:image/png;base64,");
        assertEquals("data:image/png;base64,", branding.getLogo());
    }

    @Test(expected = IllegalArgumentException.class)
    public void test_setLogo_ThrowsAnIllegalArgumentException_WhenAnInvalidUrlIsSpecified() {
        branding.setLogo("htt://blah");
    }

    @Test
    public void test_setLogo_DoesNothing_WhenANullUrlIsSpecified() {
        branding.setLogo(null);
        assertNull(branding.getLogo());
    }

    @Test
    public void test_setLogo_DoesNothing_WhenAnEmptyUrlIsSpecified() {
        branding.setLogo(" ");
        assertNull(branding.getLogo());
    }

}
